const React = require ('react')


class Index extends React.Component{
    render(){
        //map our fruits data to where we want it to go
        const{fruits}= this.props;
        const{veggies}= this.props;
        return(
            <div>
                <nav>
                <a href="/fruits/new">Create a New Fruit</a><br/>
                <a href="/veggies/NewVeg">Create a New Veggie</a>
                </nav>
                <h1>Fruits & Veggies Index Page</h1>
                <ul>
                    {fruits.map((fruit,i)=>{
                       return(
                        <li key={i}>
                    The{' '}
                    {/**Make sure it is calling fruit.id */}
                    <a href={`/fruits/${ fruit.id }`}>{fruit.name}</a>
                    {' '}
                    is {fruit.color}<br/>
                    {fruit.readyToEat ? 'It is ready to eat' : 'Nope, it is not good to eat'}
                    <br/>
                  </li>
                       ) 
                    })}
                </ul>
                    <br/>
                    <ul>
                    {veggies.map((veggie,i)=>{
                       return(
                        <li key={i}>
                    The{' '}
                    {/**Make sure it is calling veggie.id */}
                    <a href={`/veggies/${ veggie.id }`}>{veggie.name}</a>
                    {' '}
                    is {veggie.color}<br/>
                    {veggie.readyToEat ? 'It is ready to eat' : 'Nope, it is not good to eat'}
                    <br/>
                  </li>
                       ) 
                    })}
                </ul>
                    

            </div>
        )
    }
}

module.exports = Index;

